style_setting_options.value:
#wrapper-throbber-box > #throbber-box > #navigator-throbber,
#navigator-throbber {
  margin: -1px 2px -1px 10px !important;
  border: 2px solid !important;
  -moz-border-top-colors: ThreeDDarkShadow ThreeDHighlight !important;
  -moz-border-right-colors: ThreeDDarkShadow ThreeDShadow !important;
  -moz-border-bottom-colors: ThreeDDarkShadow ThreeDShadow !important;
  -moz-border-left-colors: ThreeDDarkShadow ThreeDHighlight !important;
  cursor: pointer !important;
}

#wrapper-throbber-box > #throbber-box > #navigator-throbber:hover:active,
#navigator-throbber:hover:active {
  -moz-border-top-colors: ThreeDDarkShadow ThreeDShadow !important;
  -moz-border-right-colors: ThreeDDarkShadow ThreeDHighlight !important;
  -moz-border-bottom-colors: ThreeDDarkShadow ThreeDHighlight !important;
  -moz-border-left-colors: ThreeDDarkShadow ThreeDShadow !important;
}

window[chromehidden~="toolbar"] #navigator-throbber,
toolbar[mode="text"] #wrapper-throbber-box > #throbber-box > #navigator-throbber,
toolbar[iconsize="small"] #wrapper-throbber-box > #throbber-box > #navigator-throbber,
toolbar[mode="text"] #navigator-throbber,
toolbar[iconsize="small"] #navigator-throbber {
  margin: 0 5px !important;
}

#navigator-throbber {
  margin: 6px 10px 0px 8px;
  border-top: 1px solid #B9BFC7;
  border-right: 1px solid #A1AAB3;
  border-bottom: 1px solid #DEE7EE;
  border-left: 1px solid #A4ACB5;
}

toolbar[mode="icons"] #navigator-throbber {
  margin: 4px 8px 2px 8px;
}

toolbar[mode="text"] #navigator-throbber,
toolbar[iconsize="small"] #navigator-throbber {
  margin: 2px 4px 2px 6px;
}
